import React from "react";
import { Container, Grid, Card } from "semantic-ui-react";
import RankIcon from "./RankIcon";

function ProfileInfo() {
  return (
    <Card fluid={"true"}>
      <Grid.Column>
        <RankIcon />
        <Container as="h1">{localStorage.username}</Container>
      </Grid.Column>
    </Card>
  );
}

export default ProfileInfo;
